  [],\n\t\"revision_timestamp\": \"2015-07-08T19:25:28.515091\",\n\t\"name\": \"measures-greenland-ice-sheet-velocity-map-from-insar-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This data set, part of the NASA Making Earth
  System Data Records for Use in Research Environments (MEaSUREs) program, provides
  annual ice-sheet-wide velocity maps for Greenland, derived using Interferometric
  Synthetic Aperture Radar (InSAR) data from the RADARSAT-1 satellite. The data set
  currently contains ice velocity data for the winter of 2000-2001 and 2005-2006,
  2006-2007, and 2007-2008 acquired from RADARSAT-1 InSAR data from the Alaska Satellite
  Facility (ASF), and a 2008-2009 mosaic derived from the Advanced Land Observation
  Satelitte (ALOS) and TerraSAR-X data. nnData are available via FTP, in 4-byte big-endian
  Institute of Electrical and Electronics Engineers (IEEE) floating point and GeoTIFF
  (.tif) formats.nn<strong>Note</strong>: Although this data set has been screened
  for anomalously large errors, at this stage they are Version 1 products and some
  significant errors may persist (>20 m/yr). In addition, these data are considered
  provisional pending a review by the MEaSUREs program. Once the data have been reviewed,
  this statement will be removed.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
